:root {
  /*Breakpoints
  // custom properties don't work in media queries ;(
  --break-xs: 280px;
  --break-sm: 320px;
  --break-sm: 360px;
  --break-md: 567px;
  --break-lg: 768px;
  --break-xl: 1024px;
  --break-xxl: 1400px;
  */
  --black: 0 0% 0%;
  /* #000 */
  --dark: 189 50% 10%;
  /* hsl(0 0% 7% / 1); /* #111111;*/
  --white: 0 100% 100%;
  --light: 189 100% 98%;
  --prim-lgt: 32 85% 95%;
  --prim: 32 100% 60%;
  --prim-drk: 32 85% 40%;
  --main-lgt: 189 60% 95%;
  --main: 189 50% 70%;
  --main-drk: 189 30% 70%;
  --acc1-lgt: 46 80% 95%;
  --acc1: 46 100% 80%;
  --acc1-drk: 46 30% 70%;
  --acc2-lgt: 100 29% 92%;
  --acc2: 100 54% 85%;
  --acc2-drk: 100 85% 80%;
  --tec-lgt: 0 0% 92%;
  --tec: 0 25% 80%;
  --tec-drk: 0 0% 25%;
  --btn-bg: hsl(var(--prim) / 1);
  --btn-color: hsl(var(--light) / 1);
  --btn-padding: 0.5rem 0.5rem 0.5rem 0.5rem;
  --btn-radius: 10px;
  --baseFontSize: 18;
  --baseLineHeight: 1.5;
  --leading: calc(var(--baseLineHeight) * 1rem);
  --scale: 1.414 /* original: 1.414 */;
  --fs-xs: 10px;
  --fs-sm: 14px;
  --fs-md: calc(var(--baseFontSize) / 16 * 100%);
  --fs-medico: calc(var(--baseFontSize) / 16 * 106.5%);
  --fs-xl: 64px;
  --fw-xs: 200;
  --fw-sm: 300;
  --fw-md: 400;
  --fw-lg: 600;
  --fw-xl: 700;
  --rad-xs: 4px;
  --rad-md: 8px;
  --rad-lg: 16px;
  --rad-xl: 32px;
  --shad-md: 0px 10px 15px -3px hsl(var(--dark) / 1),
    0px 10px 15px -3px hsl(var(-dark) / 1);
  --body-bg-gradient: linear-gradient(
    to bottom,
    hsl(var(--main-lgt) / 1) 0%,
    hsl(var(--main) / 1) 45%,
    hsl(var(--main-drk) / 1) 50%,
    hsl(var(--main) / 1) 75%,
    hsl(var(--main-lgt) / 1) 90%
  );
  --body-bg: hsl(var(--light) / 1);
  --body-color: hsl(var(--black) / 1);
  --padd-xs: 0.25rem;
  --padd-sm: 0.5rem;
  --padd-md: 0.75rem;
  --padd-1: 1rem;
  --padd-lg: 2rem;
  --padd-xl: 4rem;
  --content-width: 1100px;
  --content-padding: var(--padd-lg);
}

body.dark {
  --black: 0 100% 100%;
  /* black turns white */
  --dark: 0 100% 98%;
  /* dark turn to light */
  --grey-drk: 0 0% 20%;
  --prim-lgt: 211 52% 22%;
  --prim: 211 52% 22%;
  /* petrol / #2f8d85 */
  --prim-drk: 211 52% 22%;
  --main-lgt: 47 47% 95%;
  --main: 47 47% 95%;
  --main-drk: 47 47% 95%;
  --acc1-lgt: 0 0% 0;
  --acc1: 0 0% 0;
  --acc1-drk: 0 0% 0;
  --light: 0 0% 10%;
  /* light turns to dark grey */
  --white: 0 100% 0%;
  /* white turns to dark */
}

html {
  box-sizing: border-box;
  scroll-behavior: smooth;
}

*,
*:before,
*:after {
  box-sizing: inherit;
}

body {
  background: var(--body-bg);
  min-height: 100vh;
  width: 100%;
  overflow-x: hidden;
}

@media screen and (min-width: 768px) {
  .anchor {
    display: block;
    position: relative;
    top: -120px;
  }
}
/* Layout */
article {
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: [header] auto [main] 1fr [footer] auto;
  min-height: 100vh;
}

/* froala editor css */
.fr-img-caption {
  background: var --white;
  border-radius: var(--rad-xs);
  display: block;
  margin: 0 0 20px 0;
  padding: 0 0 5px 0;
  position: relative;
  top: 17px !important;
}
.fr-img-caption img {
  width: 100% !important;
  border-radius: 4px 4px 0 0;
}

.fr-inner {
  display: block;
  font-size: 12px;
  padding: 10px 10px 5px 10px;
  margin: 0;
}

.fr-fic {
  border-radius: 4px;
  max-width: 100% !important;
}

.fr-fil {
  float: left;
  margin: 0 20px 10px 0;
  position: relative;
  top: 5px;
}

.fr-fir {
  float: right;
  margin: 0 0 10px 20px;
  position: relative;
  top: 5px;
}

/*! Typebase.less v0.1.0 | MIT License */
/* Setup */
html {
  font-family: system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji";
  font-size: var(--fs-md);
  -webkit-font-smoothing: antialiased;
}

body {
  color: var(--body-color);
}
body a {
  text-decoration: none;
}

p {
  line-height: var(--leading);
  margin-top: calc(var(--leading) / 1.6);
  margin-bottom: 0;
}
p a {
  text-decoration: underline;
}

ul,
ol {
  margin-top: var(--leading);
  margin-bottom: var(--leading);
}
ul li,
ol li {
  line-height: var(--leading);
}
ul ul,
ul ol,
ol ul,
ol ol {
  margin-top: 0;
  margin-bottom: 0;
}

blockquote {
  line-height: var(--leading);
  margin-top: var(--leading);
  margin-bottom: var(--leading);
}

/* Headings */
h1,
h2,
h3,
h4,
h5,
h6 {
  margin-top: var(--leading);
  margin-bottom: 0;
  line-height: var(--leading);
}

h1 {
  font-size: calc(2.4 * var(--scale) * 1rem);
  font-weight: var(--fw-lg);
  line-height: calc(2.4 * var(--leading));
  margin-top: calc(4 * var(--leading));
}

h2 {
  font-size: calc(1.4 * var(--scale) * 1rem);
  line-height: calc(1.4 * var(--leading));
  margin-top: calc(1.4 * var(--leading));
}

h3 {
  font-size: calc(0.9 * var(--scale) * 1rem);
}

h4 {
  font-size: calc(var(--scale) / 1.414 * 1rem);
}

h5 {
  font-size: calc(var(--scale) / 3 * 1rem);
}

h6 {
  font-size: calc(var(--scale) / 4 * 1rem);
}

/* Tables */
table {
  margin-top: var(--leading);
  border-spacing: 0px;
  border-collapse: collapse;
}
table td,
table th {
  padding: 0;
  line-height: calc(var(--baseLineHeight) * var(--baseFontSize) - 0px);
}

/* Code blocks */
code {
  vertical-align: bottom;
}

.lead {
  font-size: calc(var(--scale) * 1rem);
}

.hug {
  margin-top: 0;
}

.primary {
  color: hsl(var(--prim)/1);
}

.placeitemscenter {
  display: grid;
  place-items: center;
}

.indent-me {
  box-sizing: border-box;
  max-width: var(--content-width);
  padding: var(--content-padding);
  margin: 0 auto;
  width: 100%;
}

.btn,
.button {
  display: inline-block;
  padding: var(--btn-padding);
  border-radius: var(--btn-radius);
  color: var(--btn-color);
  position: relative;
  text-decoration: none;
  transition: all 0.3s;
  overflow: hidden;
  z-index: 1;
}
.btn:after,
.button:after {
  content: "";
  position: absolute;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: var(--btn-bg);
  border-radius: var(--btn-radius);
  z-index: -2;
}
.btn:before,
.button:before {
  content: "";
  position: absolute;
  bottom: 0;
  left: 0;
  width: 0%;
  height: 100%;
  background-color: hsl(var(--light)/0.25);
  transition: all 0.3s;
  border-radius: var(--btn-radius);
  z-index: -1;
}
.btn:hover,
.button:hover {
  color: var(--btn-color);
}
.btn:hover:before,
.button:hover:before {
  width: 100%;
}

.contactbox {
  display: none;
}
.contactbox a {
  color: hsl(var(--light)/1);
  border: none;
  display: block;
  transform: translateY(3px);
}
.contactbox a:hover {
  color: hsl(var(--prim));
}
.contactbox a .fa-clock {
  top: 4px;
}
.contactbox a .fa-envelope {
  top: 5px;
}
.contactbox a .fa-phone-alt {
  top: 2px;
}
.contactbox a .fa-lightdark {
  color: hsl(var(--dark));
}

header nav #menu-toggle:checked ~ .contactbox {
  background: transparent;
  border: none;
  display: flex !important;
  gap: 1rem;
  place-items: center;
  position: absolute;
  left: 2rem;
  top: 1rem;
  z-index: 2000;
}
header nav #menu-toggle:checked ~ .contactbox svg {
  height: 28px;
  width: 28px;
}

@media screen and (min-width: 768px) {
  .contactbox {
    background: hsl(var(--prim)/0.5);
    border-left: 1px solid hsl(var(--dark)/1);
    display: flex;
    gap: var(--padd-md);
    height: 100%;
    justify-content: center;
    place-items: center;
  }
  .contactbox svg {
    height: 20px;
    width: 20px;
    filter: drop-shadow(2px 2px 2px hsl(var(--dark)));
  }
}
.faq {
  width: 100%;
}
.faq details {
  border-top: 1px solid hsl(var(--dark)/0.2);
  padding: var(--padd-xs) 0 var(--padd-xs) 0;
}
.faq details:last-child {
  border-bottom: 1px solid hsl(var(--dark)/0.2);
}
.faq details[open] {
  padding-bottom: 0;
}
.faq summary {
  padding: 0 1rem 0 1rem;
  margin: 0;
  cursor: pointer;
  border-radius: 5px;
}
.faq summary::-webkit-details-marker,
.faq summary::marker {
  display: none !important;
  content: "";
  /* fix for chrome */
}
.faq summary:after {
  content: "";
  width: 10px;
  height: 10px;
  transform: rotate(45deg);
  transition: all 0.5s ease-out;
  border-bottom: 1px solid hsl(var(--dark));
  border-right: 1px solid hsl(var(--dark));
  float: right;
  position: relative;
  top: -30px;
}
.faq h3 {
  font-size: inherit;
  font-weight: var(--fw-md);
  margin: 0;
  padding: var(--padd-xs) 0 var(--padd-xs) 0;
}
.faq details[open] div {
  animation: blend-in 0.5s ease-out;
  /*background: linear-gradient(to bottom, #fff 0%, #eee 100%);*/
  margin: 1rem 0 0 0;
  padding: 0 1rem 0.5rem 1rem;
}
@keyframes blend-in {
  0% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
}
.faq details[open] summary:after {
  content: "";
  transform: rotate(-135deg);
  margin-top: 8px;
}
.faq details[open] summary:after {
  content: "";
  transform: rotate(-135deg);
  margin-top: 8px;
}
.faq summary > h4 {
  display: inline;
  font-size: 20px;
  font-weight: 400;
}
.faq details[open] summary > h3 {
  font-weight: 800;
}

footer {
  background: hsl(var(--dark)/1);
  color: hsl(var(--light));
  display: block;
  height: auto;
}
footer .faq details {
  border-top: 1px solid hsl(var(--light)/0.6);
  padding: var(--padd-md) 0 var(--padd-md) 0;
}
footer .faq details:last-child {
  border-bottom: 1px solid hsl(var(--light)/0.6);
}
footer .faq details summary:after {
  border-bottom: 1px solid hsl(var(--light));
  border-right: 1px solid hsl(var(--light));
  position: relative;
  top: 2px;
}
footer .faq details div a {
  color: hsl(var(--light));
}
footer .faq .langselect {
  border-top: 1px solid hsl(var(--light)/0.6);
  padding: var(--padd-md) 0 var(--padd-md) var(--padd-1);
}
footer .faq .langselect a {
  color: hsl(var(--light));
  display: inline-block;
  padding: var(--padd-xs);
}
footer .faq .langselect a:hover {
  color: hsl(var(--prim));
}
footer .faq .langselect a.selected {
  background: hsl(var(--light)/0.2);
  border-radius: var(--rad-xs);
}
footer .faq .byline {
  border-top: 1px solid hsl(var(--light)/0.6);
  line-height: 1.1rem;
  padding: var(--padd-md) 0 var(--padd-md) var(--padd-1);
}
footer .faq .byline a {
  color: hsl(var(--light));
}
footer .faq .byline a:hover {
  color: hsl(var(--prim));
}

.gallery {
  /*
  	100% Height for Opera as the max-height seems to be ignored, not optimal for large screens
  	http://bricss.net/post/11230266445/css-hack-to-target-opera
  */
}
.gallery .lb-album {
  list-style: none;
  padding-bottom: 2rem;
  padding: 0 !important;
  display: inline-block;
}
.gallery .lb-album li {
  float: left;
  margin: 10px 10px 0 0;
}
.gallery .lb-album li > a,
.gallery .lb-album li > a img {
  display: block;
}
.gallery .lb-album li > a {
  width: 200px;
  height: 150px;
}
.gallery .lb-overlay {
  background: hsl(var(--grey-drk)/1);
  display: none !important;
  height: 0px;
  overflow: hidden;
  padding: 0 0 0 0;
  position: fixed;
  left: 0px;
  top: 0;
  text-align: center;
  width: 0px;
  z-index: 999999;
}
.gallery .lb-overlay .controls {
  margin: 0 0 0 -250px;
  opacity: 0;
  position: absolute;
  left: 50%;
  top: 25px;
  width: 500px;
  z-index: 1001;
}
.gallery .lb-overlay .controls .svg-inline--fa {
  color: hsl(var(--light)/1);
  height: 50px;
  width: 50px;
}
.gallery .lb-overlay img {
  box-shadow: 0px 2px 7px rgba(255, 255, 255, 0.2);
  height: auto;
  max-height: 70vh;
  position: relative;
  top: 0;
  width: auto;
  max-width: 90vw;
}
.gallery .lb-overlay .info {
  color: hsl(var(--light)/1);
  margin: 10px auto 0 auto;
  max-width: 1000px;
  opacity: 0;
  position: relative;
  top: 0;
  text-shadow: 0px 1px 1px rgba(255, 255, 255, 0.6);
  transition: opacity 1s linear 1.2s;
}
.gallery .lb-overlay .info h3 {
  display: inline-block;
  border-right: 1px solid hsl(var(--light)/1);
  padding: 0.75rem 1rem 0.75rem 0 !important;
}
.gallery .lb-overlay .info p {
  display: inline-block;
  padding: 0 0 0 1rem;
}
.gallery .lb-overlay:target {
  display: block !important;
  width: auto;
  height: auto;
  bottom: 0px;
  right: 0px;
  padding: 80px 0.25rem 120px 0.25rem;
}
.gallery .lb-overlay:target img {
  animation: fadeInScale 1.2s ease-in-out;
}
.gallery .lb-overlay:target .controls,
.gallery .lb-overlay:target .info {
  opacity: 1;
}
@-webkit-keyframes fadeInScale {
  0% {
    -webkit-transform: scale(0.6);
    opacity: 0;
  }
  100% {
    -webkit-transform: scale(1);
    opacity: 1;
  }
}
@-moz-keyframes fadeInScale {
  0% {
    -moz-transform: scale(0.6);
    opacity: 0;
  }
  100% {
    -moz-transform: scale(1);
    opacity: 1;
  }
}
@-o-keyframes fadeInScale {
  0% {
    -o-transform: scale(0.6);
    opacity: 0;
  }
