header nav #logo {
  width: 90%;
}
header nav #logo svg {
  display: block;
  margin-right: var(--padd-md);
}
header nav input#menu-toggle {
  display: none;
}
header nav label.menu-button-container {
  display: flex;
  height: 100%;
  position: relative;
  top: 2rem;
  right: 2rem;
  width: 30px;
  cursor: pointer;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}
header nav label.menu-button-container .menu-button,
header nav label.menu-button-container .menu-button::before,
header nav label.menu-button-container .menu-button::after {
  display: block;
  background-color: hsl(var(--dark));
  position: absolute;
  height: 4px;
  width: 30px;
  transition: transform 400ms cubic-bezier(0.23, 1, 0.32, 1);
  border-radius: 2px;
  z-index: 1200;
}
header nav label.menu-button-container .menu-button::before {
  content: "";
  margin-top: -8px;
}
header nav label.menu-button-container .menu-button::after {
  content: "";
  margin-top: 8px;
}
header nav #menu-toggle:checked + .menu-button-container .menu-button {
  position: fixed;
}
header nav #menu-toggle:checked + .menu-button-container .menu-button::before {
  background-color: hsl(var(--light)/1);
  margin-top: 0px;
  transform: rotate(405deg);
}
header nav #menu-toggle:checked + .menu-button-container .menu-button {
  background-color: transparent;
}
header nav #menu-toggle:checked + .menu-button-container .menu-button::after {
  background-color: hsl(var(--light)/1);
  margin-top: 0px;
  transform: rotate(-405deg);
}
header nav ul.menu {
  height: 0;
  left: 0;
  margin: 0;
  position: absolute;
  width: 100%;
}
header nav ul.menu li {
  height: 0;
  transition: height 400ms cubic-bezier(0.23, 1, 0.32, 1);
  overflow: hidden;
}
header nav ul.menu li a {
  color: hsl(var(--light));
}
header nav #menu-toggle:checked ~ .menu {
  align-items: flex-end;
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
  background: hsl(var(--dark));
  min-height: 100vh;
  padding-inline-start: 0px;
  position: fixed;
  z-index: 1100;
}
header nav #menu-toggle:checked ~ .menu li {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 2.5em;
  padding: var(--padd-xs);
  transition: height 400ms cubic-bezier(0.23, 1, 0.32, 1);
  width: 100%;
}
header nav #menu-toggle:checked ~ .menu li:not(:last-child) {
  border-bottom: 1px solid hsl(var(--light)/0.4);
}
header nav #menu-toggle:checked ~ .menu li a {
  display: inline-block;
  text-align: center;
  width: 100%;
}

