sources.partials/header.scss:
header {
  nav {
    display: flex;
    justify-content: space-between;
    height: auto;
    width: 100%;

    /* Logo /////////////////////////////////////*/
    #logo {
      width: 90%;

      svg {
        display: block;
        margin-right: var(--padd-md);
      }
    }

    /* Switch ////////////////////////////////*/
    input#menu-toggle {
      display: none;
    }

    label.menu-button-container {
      display: flex;
      height: 100%;
      position: relative;
      top: 2rem;
      right: 2rem;
      width: 30px;
      cursor: pointer;
      flex-direction: column;
      justify-content: center;
      align-items: center;

      .menu-button,
      .menu-button::before,
      .menu-button::after {
        display: block;
        background-color: hsl(var(--dark));
        position: absolute;
        height: 4px;
        width: 30px;
        transition: transform 400ms cubic-bezier(0.23, 1, 0.32, 1);
        border-radius: 2px;
        z-index: 1200;
      }

      .menu-button::before {
        content: "";
        margin-top: -8px;
      }

      .menu-button::after {
        content: "";
        margin-top: 8px;
      }
    }
    #menu-toggle:checked + .menu-button-container .menu-button {
      position: fixed;
    }

    #menu-toggle:checked + .menu-button-container .menu-button::before {
      background-color: hsl(var(--light) / 1);
      margin-top: 0px;
      transform: rotate(405deg);
    }

    #menu-toggle:checked + .menu-button-container .menu-button {
      background-color: transparent;
    }

    #menu-toggle:checked + .menu-button-container .menu-button::after {
      background-color: hsl(var(--light) / 1);
      margin-top: 0px;
      transform: rotate(-405deg);
    }

    /* Navigation //////////////////////////////*/
    ul.menu {
      height: 0;
      left: 0;
      margin: 0;
      position: absolute;
      width: 100%;

      li {
        height: 0;
        transition: height 400ms cubic-bezier(0.23, 1, 0.32, 1);
        overflow: hidden;

        a {
          color: hsl(var(--light));
        }
      }
    }

    #menu-toggle:checked ~ .menu {
      align-items: flex-end;
      display: flex;
      flex-direction: column;
      justify-content: flex-end;
      background: hsl(var(--dark));
      min-height: 100vh;
      padding-inline-start: 0px;
      position: fixed;
      z-index: 1100;
    }

    #menu-toggle:checked ~ .menu li {
      display: flex;
      justify-content: center;
      align-items: center;
      height: 2.5em;
      padding: var(--padd-xs);
      transition: height 400ms cubic-bezier(0.23, 1, 0.32, 1);
      width: 100%;

      &:not(:last-child) {
        border-bottom: 1px solid hsl(var(--light) / 0.4);
      }

      a {
        display: inline-block;
        text-align: center;
        width: 100%;
      }
    }

    /* ! contactbox.scss */
  }
}

