sources.partials/introvisual.scss:
.intro {
  width: 100%;

  .introvisual {
    overflow: hidden;
    height: var(--shift);
    width: 100%;

    img {
      animation: kenburns 8s ease;
      filter: saturate(0.4);
      height: var(--shift);
      position: relative;
      width: 100%;
    }

    .overlay {
      text-align: center;
      text-shadow: 1px 1px 20px hsl(var(--light));
      width: 100%;
      z-index: 100;

      h1 {
        font-size: var(--font-size);
        line-height: calc(var(--font-size) * var(--leading));
      }
    }
  }

  .introtext {
    width: 100% {
      margin-top: 0;
    }
  }

  /* Animation Keyframes */

  @-webkit-keyframes kenburns {
    0% {
      //transform-origin: center; Lighthosue doesnt love me ;(
      transform: scale(1.2);
    }
    50% {
      transform: scale(1.1);
    }

    100% {
      transform: scale(1);
    }
  }

  @-webkit-keyframes movefirst {
    0% {
      opacity: 0;
    }

    100% {
      opacity: 1;
    }
  }

  @-webkit-keyframes movesecond {
    0% {
      transform: translateX(-400%);
    }

    100% {
      transform: translateX(0%);
    }
  }
}

